import { useState } from 'react';
import Header from './components/Header/Header';
import NewUsers from './pages/NewUsers/NewUsers';
import ContentContainer from './components/ContentContainer/ContentContainer';

/**
 * Represents a user profile component.
 *
 * @component
 * @param {Object} props - The component props.
 * @param {string} props.userName - The name of the user.
 * @param {string} props.bio - The biography of the user.
 * @returns {React.ReactElement} A user profile element.
 */

function App() {
  const [content, setContent] = useState(<NewUsers></NewUsers>);

  const changeContent = (content) => {
    setContent(content);
  };

    return (
    <>
    <Header reqContent={changeContent}></Header>
    <ContentContainer content={content}></ContentContainer>
    </>
  );
}

export default App;
